g.script:
function setupClicks() {
var paths = document.querySelectorAll('path'); // მოძებნის ყველა path ელემენტს

paths.forEach(function(path) {
path.addEventListener('click', function() {
var muscleId = path.getAttribute('id'); // აიღებს path-ის id-ს
if (muscleId) {
Android.onMuscleClicked(muscleId); // გამოიძახებს Kotlin ფუნქციას
}
});
});
}

setupClicks();
